INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (4, 10021, 0.0, 110501, 24015, "カオリ（サマー）", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 4, 0.0, 0.0, "2030/12/17 14:59:59", 1, "2019/07/31 12:00:00", 24);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (1, 10021, 0.0, 110501, 24016, "カオリ（サマー）", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 4, 4.0, 0.0, "2030/12/17 14:59:59", 2, "2019/07/31 12:00:00", 24);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (4, 10021, 0.0, 110501, 24017, "カオリ（サマー）", "マジムンだらけで目が回るさ～！\nふらふらさ～！", 4, 0.0, 0.0, "2030/12/17 14:59:59", 3, "2019/07/31 12:00:00", 24);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (2, 10021, 0.0, 110501, 24018, "カオリ（サマー）", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 1, 5.2, 0.0, "2030/12/17 14:59:59", 4, "2019/07/31 12:00:00", 24);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (6, 10021, 0.0, 110501, 24019, "カオリ（サマー）", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 5, 4.2, 0.0, "2030/12/17 14:59:59", 5, "2019/07/31 12:00:00", 24);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (2, 10021, 0.0, 110501, 24020, "カオリ（サマー）", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 2, 0.0, 0.0, "2030/12/17 14:59:59", 6, "2019/07/31 12:00:00", 24);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (6, 10021, 0.0, 110501, 24021, "カオリ（サマー）", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 1, 6.4, 0.0, "2030/12/17 14:59:59", 7, "2019/07/31 12:00:00", 24);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (2, 10021, 0.0, 110501, 24022, "カオリ（サマー）", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 2, 0.0, 0.0, "2030/12/17 14:59:59", 8, "2019/07/31 12:00:00", 24);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (3, 10021, 0.0, 110501, 24023, "カオリ（サマー）", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 6, 10.08, 0.0, "2030/12/17 14:59:59", 9, "2019/07/31 12:00:00", 24);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (2, 10021, 0.0, 110501, 24024, "カオリ（サマー）", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 1, 5.0, 0.0, "2030/12/17 14:59:59", 10, "2019/07/31 12:00:00", 24);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (2, 10021, 0.0, 110501, 24025, "カオリ（サマー）", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 2, 0.0, 0.0, "2030/12/17 14:59:59", 11, "2019/07/31 12:00:00", 24);
